@katie_clova didn’t let the weekday morning rush get in the way of her daughter’s birthday celebration. With the right mix (and some sprinkles), she made a real splash in a flash!

"No matter how busy things get when our family heads #BackToSchool, we’re always looking for ways to carve out time for special family moments. This week, we made our mornings a little bit sweeter with the help of @KingArthurBaking's new buttermilk pancake mix. With simple added ingredients and quick prep time, we whipped up yummy, fluffy pancakes to celebrate Aimee’s birthday.”

Grab a bag of the “just-add-water” mix she used by tapping the link in our profile >> @kingarthurbaking, and share your next stack of pancakes with #KingArthurBaking.
